import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css"; // Asegúrate de que Bootstrap esté importado

const Register = () => {
  const [formData, setFormData] = useState({
    pnombre: "",
    ubicacion: "",
    identificacion: "",
    email: "",
    fechaNacimiento: "",
    snombre: "",
    papellido: "",
    sapellido: "",
    usuario: {
      login: "",
      password: "",
    },
  });

  const [showModal, setShowModal] = useState(false);
  const [modalMessage, setModalMessage] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.startsWith("usuario.")) {
      const usuarioField = name.split(".")[1];
      setFormData((prevData) => ({
        ...prevData,
        usuario: { ...prevData.usuario, [usuarioField]: value },
      }));
    } else {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const dataToSend = {
      pnombre: formData.pnombre,
      ubicacion: formData.ubicacion,
      identificacion: parseInt(formData.identificacion),
      email: formData.email,
      fechaNacimiento: formData.fechaNacimiento,
      snombre: formData.snombre,
      papellido: formData.papellido,
      sapellido: formData.sapellido,
      usuario: {
        login: formData.usuario.login,
        password: formData.usuario.password,
      },
    };

    fetch("http://localhost:9001/Laboratorio1/persona", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(dataToSend),
    })
      .then((response) => {
        if (response.ok) {
          return response.json(); // Respuesta exitosa
        } else if (response.status === 409) {
          return response.json().then(err => { // Maneja el error de conflicto
            throw new Error(err.message); // Lanza un error con el mensaje del backend
          });
        } else {
          throw new Error("Error en la solicitud");
        }
      })
      .then((data) => {
        setModalMessage("Guardado exitoso!");
        setShowModal(true);
      })
      .catch((error) => {
        setModalMessage(error.message); // Muestra el mensaje de error
        setShowModal(true);
      });
  };

  const handleCloseModal = () => {
    setShowModal(false);
    setFormData({
      pnombre: "",
      ubicacion: "",
      identificacion: "",
      email: "",
      fechaNacimiento: "",
      snombre: "",
      papellido: "",
      sapellido: "",
      usuario: {
        login: "",
        password: "",
      },
    });
  };

  return (
    <div className="container mt-5">
      <div className="card">
        <div className="card-header">
          <h2>Agregar Persona</h2>
        </div>
        <div className="card-body">
          <form onSubmit={handleSubmit}>
            {/* Aquí van los campos del formulario */}
            {/* ... (tu código de campos aquí) ... */}
            <button type="submit" className="btn btn-primary">
              Guardar
            </button>
            <button
              type="button"
              className="btn btn-secondary ms-3"
              onClick={() => window.location.href = '/login'}
            >
              Regresar a Login
            </button>
          </form>
        </div>
      </div>

      {/* Modal para mostrar mensajes */}
      <div className={`modal fade ${showModal ? "show" : ""}`} style={{ display: showModal ? "block" : "none" }} tabIndex="-1" role="dialog">
        <div className="modal-dialog" role="document">
          <div className="modal-content">
            <div className="modal-header">
              <h5 className="modal-title">Estado del Registro</h5>
              <button type="button" className="close" onClick={handleCloseModal}>
                <span>&times;</span>
              </button>
            </div>
            <div className="modal-body">
              <p>{modalMessage}</p>
            </div>
            <div className="modal-footer">
              <button type="button" className="btn btn-secondary" onClick={handleCloseModal}>
                Cerrar
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
